import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {

    return (
      <div>
      <label>{element.counter}ms</label>
      <button onClick={this.startEvent}>Start</button>
      <button onClick={this.stopEvent}>Stop</button>
  </div>
    );
  }
}

export default App;
